import React, { Component } from "react";
import Checkbox from '@material-ui/core/Checkbox';
import DeleteOutlinedIcon from '@material-ui/icons/DeleteOutlined';
import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';

class Elementos extends Component{
	state={
		acciones:false
	}
	showme=e=>{
		console.log(e.parent);
	}

	render(){
		return(
		<Container maxWidth="xs">
		<Grid
	  container
	  direction="column"
	  justify="center"
	  alignItems="center"
		>
			{this.props.lista.map((elemento,key)=>(
				<Grid container key={key} alignItems="center" spacing={1}>
				<Grid item>
					<Checkbox color="primary"/></Grid><Grid item><span onClick={this.showme}>{elemento}</span>
					<EditOutlinedIcon style={{display:"none"}} />
					<DeleteOutlinedIcon style={{display:"none"}} />
					</Grid>
				</Grid>
			))}
		</Grid >
		</Container>
		)
	}
}

export default Elementos
